const STORAGE_KEY = 'sgEvents';
const GLOBAL_THEME_KEY = 'globalStyles';
const ENCRYPT_KEY = 'sgEventsSecret';
let events = loadFromStorage() || [];

function loadFromStorage() {
    const encrypted = localStorage.getItem(STORAGE_KEY);
    if (!encrypted) return [];
    try {
        const decrypted = CryptoJS.AES.decrypt(encrypted, ENCRYPT_KEY).toString(CryptoJS.enc.Utf8);
        return JSON.parse(decrypted);
    } catch (e) {
        console.error('Error loading events:', e);
        return [];
    }
}

function saveToStorage() {
    const data = JSON.stringify(events);
    const encrypted = CryptoJS.AES.encrypt(data, ENCRYPT_KEY).toString();
    localStorage.setItem(STORAGE_KEY, encrypted);
}

function loadGlobalStyles() {
    const styles = JSON.parse(localStorage.getItem(GLOBAL_THEME_KEY)) || {
        bgColor: '#f0f0f0',
        textColor: '#000000',
        accentColor: '#007bff',
        linkColor: '#007bff'
    };
    document.body.style.backgroundColor = styles.bgColor;
    document.body.style.color = styles.textColor;
    document.querySelectorAll('button.btn-primary, button.btn-success, button.btn-secondary').forEach(btn => {
        btn.style.backgroundColor = styles.accentColor;
    });
    document.querySelectorAll('a.nav-link').forEach(a => {
        a.style.color = styles.linkColor;
    });
    document.querySelectorAll('h1, h2').forEach(h => {
        h.style.color = styles.accentColor;
    });
}

function loadSettings() {
    const styles = JSON.parse(localStorage.getItem(GLOBAL_THEME_KEY)) || {};
    document.getElementById('globalBgColor').value = styles.bgColor || '#f0f0f0';
    document.getElementById('globalTextColor').value = styles.textColor || '#000000';
    document.getElementById('globalAccentColor').value = styles.accentColor || '#007bff';
    document.getElementById('globalLinkColor').value = styles.linkColor || '#007bff';

    document.getElementById('passwordForm').addEventListener('submit', (e) => {
        e.preventDefault();
        const newPassword = document.getElementById('newPassword').value;
        localStorage.setItem('adminPassword', CryptoJS.SHA256(newPassword).toString());
        alert('Password updated');
    });

    document.getElementById('globalThemeForm').addEventListener('submit', (e) => {
        e.preventDefault();
        const styles = {
            bgColor: document.getElementById('globalBgColor').value,
            textColor: document.getElementById('globalTextColor').value,
            accentColor: document.getElementById('globalAccentColor').value,
            linkColor: document.getElementById('globalLinkColor').value
        };
        localStorage.setItem(GLOBAL_THEME_KEY, JSON.stringify(styles));
        loadGlobalStyles();
        alert('Theme updated');
    });
}

function loadEvents() {
    const eventForm = document.getElementById('eventForm');
    if (eventForm) {
        eventForm.addEventListener('submit', saveEvent);
    }
    
    const guestForm = document.getElementById('guestForm');
    if (guestForm) {
        guestForm.addEventListener('submit', generateQR);
    }
    
    populateEventsList();
    populateEventSelect();
}

function saveEvent(e) {
    e.preventDefault();
    const id = Date.now().toString();
    const event = {
        id,
        name: document.getElementById('eventName').value,
        date: document.getElementById('date').value,
        time: document.getElementById('time').value,
        venue: document.getElementById('venue').value,
        notes: document.getElementById('notes').value,
        invitationLog: document.getElementById('invitationLog').value,
        guests: []
    };
    events.push(event);
    saveToStorage();
    populateEventsList();
    populateEventSelect();
    eventForm.reset();
}

function populateEventsList() {
    const ul = document.getElementById('eventsUl');
    if (!ul) return;
    ul.innerHTML = '';
    events.forEach(event => {
        const li = document.createElement('li');
        li.className = 'list-group-item d-flex justify-content-between align-items-center';
        li.innerHTML = `
            <div>
                <strong>${event.name}</strong> - ${event.date} at ${event.time}<br>
                Venue: ${event.venue}<br>
                Notes: ${event.notes}<br>
                Invitation Log: ${event.invitationLog}
            </div>
            <button class="btn btn-danger btn-sm" onclick="deleteEvent('${event.id}')">Delete</button>
        `;
        ul.appendChild(li);
    });
}

function deleteEvent(id) {
    if (confirm('Delete this event?')) {
        events = events.filter(ev => ev.id !== id);
        saveToStorage();
        populateEventsList();
        populateEventSelect();
    }
}

function populateEventSelect() {
    const select = document.getElementById('eventSelect');
    if (!select) return;
    select.innerHTML = '<option value="">Choose Event</option>';
    events.forEach(event => {
        const option = document.createElement('option');
        option.value = event.id;
        option.textContent = event.name;
        select.appendChild(option);
    });
}

function generateQR(e) {
    e.preventDefault();
    const guestName = document.getElementById('guestName').value.trim();
    const eventId = document.getElementById('eventSelect').value;
    if (!guestName || !eventId) return alert('Please enter guest name and select an event');
    
    const event = events.find(ev => ev.id === eventId);
    if (!event) return alert('Event not found');
    if (event.guests.includes(guestName)) return alert('Guest already added');
    
    event.guests.push(guestName);
    saveToStorage();
    
    const data = JSON.stringify({ guest: guestName, event });
    const encrypted = CryptoJS.AES.encrypt(data, ENCRYPT_KEY).toString();
    const url = `invite.html?data=${encodeURIComponent(encrypted)}`;
    
    const qrCodeDiv = document.getElementById('qrCode');
    qrCodeDiv.innerHTML = '';
    new QRCode(qrCodeDiv, {
        text: url,
        width: 200,
        height: 200,
        colorDark: '#000000',
        colorLight: '#ffffff',
        correctLevel: QRCode.CorrectLevel.H
    });
    
    const downloadBtn = document.getElementById('downloadQr');
    downloadBtn.style.display = 'block';
    downloadBtn.onclick = () => {
        const canvas = qrCodeDiv.querySelector('canvas');
        if (canvas) {
            const link = document.createElement('a');
            link.download = `${event.name}_${guestName}_qr.png`;
            link.href = canvas.toDataURL();
            link.click();
        }
    };
}

